import React from 'react';
import './App.css';
import Star from './components/Star';
import { Button, Container, Col, Row, Jumbotron, Navbar, Nav } from 'react-bootstrap';
import { library } from '@fortawesome/fontawesome-svg-core';
import { fab } from '@fortawesome/free-brands-svg-icons';
import { faStar } from '@fortawesome/free-solid-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

library.add(fab, faStar)

function App() {
  return (
    <>
      <Navbar bg="dark" variant="dark">
        <Navbar.Brand href="#home"><FontAwesomeIcon icon="star" />Dash Stars App </Navbar.Brand>
        <Nav className="mr-auto">
          <Nav.Link href="#home">Home</Nav.Link>
          <Nav.Link href="#mystars">My Stars</Nav.Link>
          <Nav.Link href="#about">About</Nav.Link>
        </Nav>

      </Navbar>
      <Container className="border-1">
          <Jumbotron>
            <h1 className="text-center">React Dash Stars App</h1>
          </Jumbotron>
          <Row>
            <Col>
              <Star color="red"/>
            </Col>
            <Col>
              <Star color="yellow"/>
            </Col>
            <Col>
              <Star color="blue"/>
            </Col>
            <Col>
              <Star color="gray"/>
            </Col>
          </Row>     
        </Container>
    </>
  );
}

export default App;
